      elems[i].style.visibility = "visible";
      elems[i].style.height = "auto";
    }
    var elems = document.getElementsByClassName("preCreate");
    for (var i = 0; i < elems.length;  i++)  {
      elems[i].style.visibility = "hidden";
      elems[i].style.height = "0";
    }
  };

  var createAccount = createAccount => {
    window.location.reload();
  };
    return (
        <div class="login">
            <h1>Email Address</h1>
            <form onSubmit="">
              <label>
                <input type="text" value="ff" onChange="" />
              </label>
            </form>
            <div class="createAccount">
              <h1>Confirm Email Address</h1>
              <form onSubmit="">
                <label>
                  <input type="text" onChange="" />
                </label>
              </form>
            </div>
            <h1>Password</h1>
            <form onSubmit="">
              <label>
                <input type="text" onChange="" />
              </label>
            </form>
            <div class="createAccount">
              <h1>Confirm Password</h1>
              <form onSubmit="">
                <label>
                  <input type="text" onChange="" />
                </label>
              </form>
            </div>
            <button onClick="" class="preCreate">Login</button>
            <button onClick={createAccountExpand} class="preCreate">Sign up</button>
            <button onClick={createAccount} class="createAccount">Create</button>
        </div>
    );
}

export default Landing;
